script: |
  super -f text -I q13234.spq | sort > q13234.out

inputs:
  - name: q13234.spq
    data: |
      SELECT - col0 FROM tab1 (FORMAT parquet) cor0 WHERE col2 * + + col1 NOT BETWEEN + - col0 * + - col1 AND 91;
  - name: tab1

outputs:
  - name: q13234.out
    data: |
      -51
      -85
      -91
